import React from 'react';
import Navb from './components/nav';
import Car from './components/carousel';
import './App.css';



function App() {
  return (
    <div className="App">
     <Navb/>
     <Car/>
     <div className="diva" style={{backgroundColor:'black'}}>here</div>
     <footer>
    <p>
        We are leaders in 10 countries: 
        <span className="country-link"> Poland</span>, 
        <span className="country-link">Turkey</span>, 
        <span className="country-link">Spain</span>, 
        <span className="country-link">Italy</span>, 
        <span className="country-link">Czech Republic</span>, 
        <span className="country-link">Mexico</span>, 
        <span className="country-link">Colombia</span>, 
        <span className="country-link">Brazil</span>, 
        <span className="country-link">Argentina</span> and 
        <span className="country-link">Chile</span> <br/><br/>
        This site uses cookies to deliver services in accordance with this Privacy Policy. You can specify the
        conditions for storing or accessing cookies on your browser.<br/>
        www.docplanner.com Â© 2019
    </p>
</footer> 


    </div>
  );
}

export default App;
